INSERT INTO `role` VALUES (1,1,1,'高元圆',' 精于算计，小气，抠门，大龄单身男，别人一提到他单身的事情就暴躁，因为感情的迷宫走不通，所以只能在事业上发奋图强，成天想着把事业做大、上市、做土豪，却是“心比天高，命比纸薄”，每天只能坐在小办公室里逞逞威风。','圆圆快递公司总经理','/images/s1/roles/1.jpg','/upload/11532gaoyuanyuan.jpg','高栋梁的漆黑的舞台上，我们能隐约看到一个人影。忽然，“咔”地一声，一束追光打在那人的身上。这是一个头顶发亮反光，身高体重比例接近1:1的男人。他穿着一身帅气西装，系上红色领带的结，将头发梳成大人模样，手里拿着一支枯萎的玫瑰，流下一滴眼泪。',1),(2,1,1,'唐可德','男 22岁左右;  胆小怕事，力大无穷，有着高大健硕、英俊迷人外表，却操着一口方言，性格憨厚老实，说话时经常不经意间戳中别人的痛楚。','圆圆快递公司员工','/images/s1/roles/2.jpg','','他拥有巴特尔的身高、都教授的皮囊、施瓦辛格的肌肉，李敏镐的笑容，多重优秀的元素集合在一起，就只能用一个词来表达：“有机”；用一个字来形容，那就是“帅”！他就是帅到让人无以言表！',1),(3,1,1,'乔布乔','爱美但不娘，既矫情又善良，跑步速度非常快，有人工GPS的称号，总能准时快速的把快递送到客户的手里。','圆圆快递公司员工','/images/s1/roles/3.jpg','','总是说“太阳最红，乔布乔最亲，我的光辉思想永远照客户心”他的短信暖心效果最为明显，这早一条，晚一条，天冷一条，天热一条，处处关心，时时嘱咐的架势，真是女性同胞的贴心密友，男性同胞的呕吐对象。',1),(4,1,1,'贾冰月',' 女  25岁  漂亮、性感、爽快、干练，擅长算数、谈业务，超级大路痴，是高元圆的梦中情人，高元圆经常对她束手无策。','圆圆快递公司总经理','/images/s1/roles/4.jpg','','好似X战警里的魔形女，这么说她，不是因为她能变身，而是因为她是个能百变造型的大姐大。干活时她是个爷们儿，拉客户时她是女王般的御姐，解决纠纷时她是干练的OL，碰到爱情问题时她是清纯学生妹，反正你能想到的款她都能扮上',1),(5,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/others.jpg','','',1),(6,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/6.jpg','','',1),(7,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/7.jpg','','',1),(8,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/8.jpg','','',1),(9,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/9.jpg','','',1),(10,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/10.jpg','','',1),(11,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/11.jpg','','',1),(12,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/12.jpg','','',1),(13,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/13.jpg','','',1),(14,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/14.jpg','','',1),(15,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/15.jpg','','',1),(16,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/16.jpg','','',1),(17,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/17.jpg','','',1),(18,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/18.jpg','','',1),(19,1,3,'其他','剧本中出现的所有其他人...','','/images/s1/roles/19.jpg','','',1),