INSERT INTO `series` VALUES (1,'一不小心件到你','四十几岁还单身的高元圆被一位高人断定今生爱情无望，因此他决定专心发展事业，于是他成立了一个小快递公司——圆圆快递，招了三个各有特长的员工唐可德、贾冰月、乔布乔，从此他们就团结合作、努力奋斗，最终小公司变成了大公司，他们身家暴增成为行业领先者……咔，我们这不是一部俗套的职场励志剧！ \r\n 我们的故事是这样的：圆圆快递公司隐藏在一条街道的深处，这里有职业碰瓷儿的、职业丐帮、拥有神奇哨子的大妈、半身不遂还能骑车的大爷以及各种各样的收件人……',1,1,1442935527),(2,'测试','新系列1',1,0,1443322135);
