CREATE TABLE `user_bonus_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增ID，主键',
  `user_id` int(10) unsigned NOT NULL COMMENT '用户id',
  `charge_type` int(4) unsigned NOT NULL COMMENT '变动方式，1为奖励充值，2为花费',
  `charge_scence_type` int(4) unsigned NOT NULL COMMENT '支付场景类型，如选演员、选造型、道具抽奖等',
  `charge_scence_id` int(10) unsigned NOT NULL COMMENT '支付场景编号，一般为点赞ID或者抽奖结果ID',
  `amount` int(10) NOT NULL COMMENT '变动数量，非空',
  `status` int(4) unsigned NOT NULL COMMENT '状态，标识该条记录是否有效，非空',
  `create_time` int(10) unsigned NOT NULL COMMENT '积分账户创建时间，unix时间戳，非空',
  `digest` char(255) DEFAULT NULL COMMENT '交易摘要',
  `provide_user_id` int(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=30918 DEFAULT CHARSET=utf8;
